import navigation from '../images/navigation.png'

let style = {
    width: 100,
    backgroundColor: "#063b50",
    borderRadius: '5px 0 0 0',
    marginRight: 2,
    cursor: 'pointer',
}

export default function Navigation() {
    return (
        <div style={style}>
            <img style={{width: 18, margin: '5px auto', display: 'flex'}} src={navigation} alt=''/>
        </div>
    )
}
